description:
Um filhote de bugio-ruivo passa por tratamento cirúrgico e recuperação no Zoológico de Gramado.

O filhote tinha uma fratura exposta, seu estado era bastante crítico. Necessitou uma delicada cirurgia para a amputação de seu braço.

Característica da espécie:

O bugio (também conhecido por guariba, barbado ou macaco-uivador):
 - pode chegar até 75cm de comprimento;
 - sua pelagem varia de tons ruivos, ruivo-acastanhados, castanho e castanho-escuro;
 - é famoso por seu grito, que pode ser ouvido em toda a mata, e pela presença de pêlos mais compridos nos lados da face, formando uma espécie de barba;

 - ocorre no Brasil, nos estados de RS, SC, PR, ES, RJ, MG e BA;

- seu habitat é a Mata Atlântica. Na floresta vivem em estratos arbóreos de 10 a 20m;

- alimenta-se de folhas (40 a 60%), principalmente folhas novas, frutos e flores;

- a gestação é de 185 a 195 dias, nascendo apenas um filhote com em média 120g. A fêmea sempre carrega o filhote, que desmama quase dois anos depois;

- está ameaçado de extinção nos estados MG e BA.

